import "./App.css";
import React from "react";
import InputForm from "./components/InputForm";
import Wallet from "./components/Wallet";

class App extends React.Component {
  render() {
    return (
      <div>
        <InputForm />
        <Wallet
          style={"page"}
          name={InputForm.state.name}
          blockchain={InputForm.state.blockchain}
          key={InputForm.state.key}
        />
      </div>
    );
  }
}

export default App;
